import React from 'react';

export default function Box({ title, item, result }) {
  return (
    <div className='box'>
      <h1>{title}</h1>

      <img
        className={
          (`item-img`,
          result === 'Win' ? 'green' : result === 'Lose' ? 'red' : 'tie')
        }
        src={item && item.img}
      />
      <h2>{result}</h2>
    </div>
  );
}
